import mongoose, { Mongoose, Schema } from "mongoose";

const userSchema = new Schema({
    name: String,
    email: String,
    branch: String,
    roll: Number,
    reg: Number,
    maths: Number,
    dsa: Number,
    be: Number,
    chemistry: Number,
    comm: Number,
    subtotal: Number,
    status: String,
});

const User = new mongoose.model("User", userSchema);

export default User;